import './App.css';
import DiaryEditor from './DiaryEdtor';
import DiaryList from './DiaryList';
function App() {
  const dummyList = [
    {
      id : 1,
      author : '유호준',
      content : '더미 일기 1',
      emotion : 5,
      created_date : new Date().getTime(),
    },
    {
      id : 2,
      author : '유호준',
      content : '더미 일기 2',
      emotion : 5,
      created_date : new Date().getTime(),
    },
    {
      id : 3,
      author : '유호준',
      content : '더미 일기 3',
      emotion : 5,
      created_date : new Date().getTime(),
    },
    {
      id : 4,
      author : '유호준',
      content : '더미 일기 4',
      emotion : 5,
      created_date : new Date().getTime(),
    },

  ];
  return (
    <div className="App">
      <DiaryEditor/>
      <DiaryList/>
    </div>
  );
}

export default App;
